import React from "react";
import './Footer.css';

function Footer() {
    return(
        <footer>
            <p>Copyright by Innerve @ {new Date().getFullYear()}</p>
            <p>Follow us!!</p>
            <p>Twitter Instagram</p>
        </footer>
    )
};

export default Footer;
